const message = $input.all()[0].json['message']['content']
const sections = $item(0).$node['Airtable Get'].json
  .fields['RFMAI Brief Fields']
  .split(',')
  .map(it => it.trim())
const result = {}
let lastIdx = 0
let lastSection = ''

for (const section of sections) {
  const idx = message.indexOf(section + ':', lastIdx)

  if (idx !== -1) {
    result[lastSection] = message
      .slice(lastIdx, idx)
      .slice(lastSection.length + 1).trim()
    lastIdx = idx
    lastSection = section
  }
}

result[sections.at(-1)] = message
  .slice(lastIdx + sections.at(-1).length + 1)
  .trim()

const output = {
  'RFMAI Status': 'done'
}

for (const section of sections) {
  output[section] = result[section]
}

return output

